import { useState } from "react";
function scooter(){
    
    let [color,setcolor]=useState("blue");
    let [brand,setbrand]=useState("Activa");
    let [rate,setrate]=useState("80,000");
    let [year, setyear]=useState("2017");

    return(
        <>
        <h1>My Scooter</h1>
        <p>Color:{color}</p>
        <p>Brand:{brand}</p>
        <p>Rate:{rate}</p>
        <p>Year:{year}</p>
        </>
    );
}
export default scooter;
